6796	6913	h	99152	1129	2022-03-08 18:34:13.289832	2023-03-27 20:35:20.87719	Air freezing index	The cumulative number of degree-days below 0C for the air temperature during a given time period. The Air Freezing Index differs from the corresponding surface Freezing Index (see n-factor). SUM (T_1) < 0 	\N	h6913	published	vernacular	\N	\N	'0':37 '0c':9 '1':36 'air':12,20 'correspond':26 'cumul':2 'day':7 'degre':6 'degree-day':5 'differ':23 'factor':33 'freez':21,28 'gcw':38 'given':16 'index':22,29 'n':32 'n-factor':31 'number':3 'period':18 'see':30 'sum':34 'surfac':27 'temperatur':13 'time':17 'trombottogeocryolog':39
1604	1711	h	99152	1129	2017-06-06 17:41:18.736116	2022-03-08 18:21:35.054156	Altitude	The vertical distance of a point above a datum. The vertical datum is usually an estimate of mean sea level. Older measurements were often determined in a local coordinate system and were not tied to a global reference frame. Some were made not with surveying instruments but with barometers, in reliance on the decrease of atmospheric pressure with altitude. It is now usual to measure altitude or elevation using the Global Positioning System or an equivalent global navigation satellite system. Altitude and elevation are synonyms in common usage, although altitude is less ambiguous. The unqualified word 'elevation' can also refer, for example, to the act of elevating or to angular distance above a horizontal plane. #{g: xqIHPGlacierMassBalance | h1629}\n\nVertical distance of a level, a point or an object considered as a point, measured from mean sea level. (TR) #{g: xqWMOHydrology | h1642}\n\nA measure (or condition) of height, especially of great height, as a mountain top or aircraft flight level. In meteorology, altitude is used almost exclusively with respect to the height of an airborne object above the earth's surface, above a constant-pressure surface, or above mean sea level. The measurement of altitude is accomplished by altimeters in aeronautics, and the entire study is called altimetry. #{g: xqAMSglossary | h1620}\n\nVertical distance above sea-level. #{g: xqPhysicalGeography | h1636}\n\n#{g: xqGCW | h1619}		h1711	archived	vernacular	\N	\N	\N
3159	3267	h	99152	1129	2017-06-06 19:36:49.070972	2022-03-08 18:21:35.799628	Seasonally-active permafrost	The uppermost layer of the permafrost which undergoes seasonal phase changes due to the lowered thawing temperature and freezing-point depression of its pore water. #{g: xqNSIDCCryosphere | h1635}\n\nThe uppermost layer of the permafrost which undergoes seasonal phase changes due to the lowered thawing temperature and freezing-point depression of its pore water #{g: xqIPAPermafrost | h1630}\n\n#{g: xqGCW | h1619}		h3267	archived	vernacular	\N	\N	\N
